              <p className='mb-[48px]'>Fusce dapibus, tellus ac cursus commodo</p>
              <button className='bg-[#e84545] lg:m-2 text-white lg:text-[15px] text-[13px] px-[43px] py-2  lg:px-[83px] lg:py-4'>DOWNLOAD HARE</button>
            </div>
        </download>
    )
}

export default Download
